(3, '[:fr]Independent cottageNew apartment 1612023076[:en]Independent cottage[:]', 'independent-cottage-mountain-view', '[:fr]<p><span style=\"color: rgb(42, 42, 42);\">Son Marimon, this B&B, is located in the municipality of Selva, at the feet of Serra de Tramuntana, recently declared World Heritage Site by UNESCO. It is five minutes away from Lloseta, a village that offers the travellers everything they need: gastronomy, theatre, concerts, shows, historical neighbourhood, library and public transport –the train will allow the travellers reach Palma, Ciutat de Mallorca, in 25 minutes and Inca, where one of the most important markets of the island take place every Thursday, in 5 minutes.</span></p><p><br /></p><p><span style=\"color: rgb(42, 42, 42);\">Wonderfully secluded, and still well connected, this 40m2 refugee also counts with 3600m2 of private land rich in autochthonous vegetation.</span></p><p><br /></p><p><span style=\"color: rgb(42, 42, 42);\">The main characteristic of the house is how little it impacts on the surroundings in order to preserve the nature. Simple designs, hand crafted furniture, clay tiles (typical Majorcan material that tells the stories lived there) and beams create a space where comfort and tradition go together.</span></p><p><br /></p><p><span style=\"color: rgb(42, 42, 42);\">The inner space comprises a sleeping room area, a sitting room with fireplace, a kitchen with oven, a microwave and fridge and an independent bathroom with shower.</span></p><p><span style=\"color: rgb(42, 42, 42);\">Son Marimon, this B&B, is located in the municipality of Selva, at the feet of Serra de Tramuntana, recently declared World Heritage Site by UNESCO. It is five minutes away from Lloseta, a village that offers the travellers everything they need: gastronomy, theatre, concerts, shows, historical neighbourhood, library and public transport –the train will allow the travellers reach Palma, Ciutat de Mallorca, in 25 minutes and Inca, where one of the mos