(14, '[:en]De Walden Street[:vi]New apartment 1612103739[:]', 'de-walden-street', '[:en]<p><span style=\"color: rgb(122, 122, 122);\">De Walden Street is a two bedroom, one bathroom home in Marylebone. This home’s open-plan living area is furnished with an elegant mix of contemporary and more classic pieces (the two well-loved leather armchairs, which sit beside the working fireplace, are especially charming), plus a bold collection of artworks. Downstairs, the two bedrooms are similarly stylish, as is the retro bathroom. What’s more, you’re only a short stroll away from all the shops and cafés of Marylebone High Street. It’s just a little further to Oxford Street, and the tube at Regent’s Park is also nearby (around a ten-minute walk).</span></p><p><br></p><p><span style=\"color: rgb(122, 122, 122);\">De Walden Street is a two bedroom, one bathroom home in Marylebone. This home’s open-plan living area is furnished with an elegant mix of contemporary and more classic pieces (the two well-loved leather armchairs, which sit beside the working fireplace, are especially charming), plus a bold collection of artworks. Downstairs, the two bedrooms are similarly stylish, as is the retro bathroom. What’s more, you’re only a short stroll away from all the shops and cafés of Marylebone High Street. It’s just a little further to Oxford Street, and the tube at Regent’s Park is also nearby (around a ten-minute walk).</span></p><p><br></p><p><span style=\"color: rgb(122, 122, 122);\"><span class=\"ql-cursor\">﻿</span>De Walden Street is a two bedroom, one bathroom home in Marylebone. This home’s open-plan living area is furnished with an elegant mix of contemporary and more classic pieces (the two well-loved leather armchairs, which sit beside the working fireplace, are especially charming), plus a bold collection of artworks. Downstairs, the two bedrooms are similarly stylish, as is the retro bathroom. What’s more, you’re only a short stroll away from all the shops and cafés of M