(19, '[:fr]Résidence la gloire[:]', 'residence-la-gloire', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">Nous louons notre magnifique appartement T3 face mer de 58m² entièrement refait à neuf. Terrasse de 10m² plein Sud avec une splendide vue sur la baie de la Baule, qui s’étend du port de Pornichet au Pouliguen. 1 chambre parentale et une petite chambre enfant dotée de son lit superposé. Idéale pour des vacances cocooning en famille les pieds dans l’eau.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Une place de parking extérieure privée disponible. Location à la semaine uniquement. pas de fumeurs, pas d’animaux, pas de réceptions/fêtes.</span></p>[:]', 5.335194, -4.075756, '[:fr]123 rue jean de la fontaine[:]', '12', NULL, NULL, NULL, NULL, '75', '75,74,73,72,71,70,69,68,67,66,65', 35000.00, 'instant', 5, 2, 1, 62.00, NULL, NULL, NULL, '[]', '28', '41,39,38,37,36,35,34,33,32,31', 'on', 1, '[:fr]Annulation possible jusqu\'à 24h avant votre date d\'arrivée.[:]', NULL, NULL, NULL, 'on', '[]', '', 21, 'publish', '2023-01-28 16:56:23', '2023-01-28 17:36:09', 'off', '', '[:fr][:]', '[]', NULL),
(20, '[:fr]Résidence Petit pays[:]', 'residence-petit-pays', '[:fr]<p>Appartement complètement rénovée (75m2) sur la digue de La Panne avec vue frontal sur mer époustouflante. A seulement quelques pas du centre et dunes, c’est l’escapade inoubliable du stress journalier. L’ascenseur vous guidera au 7eme étage ou le salon contemporain, cuisine ouverte entièrement équipée, la salle de douche moderne et les chambres à coucher agréables vous surprendront. Une terrasse sud a l’arrière complète l\'appartement. Les draps et les serviettes de bain sont disponibles&nbsp;»</p><h3><br /></h3><p>Accès direct à la plage, près du centre et des commerces-restaurants. Club de surf à côté. Pas besoin de voiture pour se déplacer, tout est accessible à pied. La voiture peut être garée dans des parking publics où on peut trouver un garage privé près pour un prix modéré.</p>[:]', 6.276195, -3.518624, '[:fr]90 rue princesse[:]', '12', NULL, NULL, NULL, NULL, '77', '85,84,83,82,81,80,79,78,77,76', 50000.00, 'instant', 5, 2, 1, 61.00, NULL, NULL, NULL, '[]', '30', '41,39,38,37,36,35,34,33,32,31', 'off', 1, '[:fr]Annulation possible jusqu\'à 24h avant votre date d\'arrivée.[:]', NULL, NULL, NULL, 'on', '[]', '', 21, 'publish', '2023-01-28 17:04:39', '2023-01-28 17:36:04', 'off', '', '[:fr][:]', '[]', NULL),
(21, '[:fr]Appartement Sublime[:]', 'appartement-sublime', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">Un endroit féerique idéal pour vous réunir, le splendide chalet les 3 Oursons surplombe la ville avec une magnifique vue sur Gérardmer à proximité de la station de ski de la Mauselaine.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Sur 3 niveaux, avec une surface de 254m², le chalet les 3 oursons bénéficie de 6 chambres, WC, 3 salles de bains</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au niveau principal : Une entrée spacieuse, un grand salon séjour avec cheminée donnant sur une cuisine américaine toute équipée (2 appareils à raclette et 2 appareils à fondue font aussi partie des équipements fournis), un WC, une chambre avec salle de bain privative et WC. Le salon séjour donne également accès à une grande et spacieuse terrasse avec table de Banquet et une plancha à gaz.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au 1er étage, 3 chambres doubles, une salle de bain spacieuse avec douche à l\'italienne, un WC.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Rez de Jardin, 2 chambres (pour 4 personnes), une grande salle de bain avec douche à l\'italienne et Sauna, une salle de jeu avec Air Hockey et Baby foot, un accès terrasse extérieur avec solarium et Jacuzzi.</span></p>[:]', 6.809107, -5.273263, '[:fr]32 rue de la poudrière[:]', '12', NULL, NULL, NULL, NULL, '145', '145,144,143,142,141,140,139,138', 35000.00, 'instant', 2, 1, 1, 34.00, NULL, NULL, NULL, '[]', '30', '41,39,38,37,36,35,34,32,31', 'off', 5, '[:fr][:]', NULL, NULL, NULL, 'on', '[]', '', 17, 'publish', '2023-01-28 20:00:41', '2023-01-29 02:44:25', 'off', '', '[:fr][:]', '[]', NULL),
(22, '[:fr]Appartement Chef de classe[:]', 'appartement-chef-de-classe', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">Un endroit féerique idéal pour vous réunir, le splendide chalet les 3 Oursons surplombe la ville avec une magnifique vue sur Gérardmer à proximité de la station de ski de la Mauselaine.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Sur 3 niveaux, avec une surface de 254m², le chalet les 3 oursons bénéficie de 6 chambres, WC, 3 salles de bains</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au niveau principal : Une entrée spacieuse, un grand salon séjour avec cheminée donnant sur une cuisine américaine toute équipée (2 appareils à raclette et 2 appareils à fondue font aussi partie des équipements fournis), un WC, une chambre avec salle de bain privative et WC. Le salon séjour donne également accès à une grande et spacieuse terrasse avec table de Banquet et une plancha à gaz.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au 1er étage, 3 chambres doubles, une salle de bain spacieuse avec douche à l\'italienne, un WC.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Rez de Jardin, 2 chambres (pour 4 personnes), une grande salle de bain avec douche à l\'italienne et Sauna, une salle de jeu avec Air Hockey et Baby foot, un accès terrasse extérieur avec solarium et Jacuzzi.</span></p>[:]', 6.809107, -5.273263, '[:fr]123 rue jean de la fontaine[:]', '12', NULL, NULL, NULL, NULL, '148', '151,150,149,148,147,146', 18000.00, 'instant', 2, 1, 1, 24.00, NULL, NULL, NULL, '[]', '30', '41,39,38,37,34,31', 'off', 5, '[:fr][:]', NULL, NULL, NULL, 'on', '[]', '', 17, 'publish', '2023-01-28 20:04:44', '2023-01-29 02:44:20', 'off', '', '[:fr][:]', '[]', NULL),
