(24, '[:fr]Résidence Claire Chantale[:]', 'residence-claire-chantale', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">Notre logement est situé dans un ancien corps de ferme, où nous avons créé 3 logements avec terrasse complètement indépendant (L\'Oxalis villas).</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Vous serez complètement indépendant au calme avec pour unique bruit le sifflement des oiseaux.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Le studio est situé dans un hameau de charme au beau milieu de la forêt.</span></p><p><span style=\"color: rgb(34, 34, 34);\">A deux pas du logement, de nombreuses balades vous attendent.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Vous pourrez aussi faire du sport, ou tout simplement vous ressourcer.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Les gros plus de ce logement :</span></p><p><span style=\"color: rgb(34, 34, 34);\">La literie (haut de gamme)</span></p><p><span style=\"color: rgb(34, 34, 34);\">La balnéothérapie</span></p><p><span style=\"color: rgb(34, 34, 34);\">La terrasse</span></p><p><span style=\"color: rgb(34, 34, 34);\">L\'emplacement en pleine nature</span></p><p><span style=\"color: rgb(34, 34, 34);\">Les équipements (ambiance lumière tamisé, choix de la couleur, Bluetooth pour mettre sa musique dans la chambre ou dans la balnéothérapie)</span></p><p><span style=\"color: rgb(34, 34, 34);\">La télévision est connectée à un lecteur de DVD, pas de chaîne (déconnexion totale)</span></p>[:]', 5.135077, -3.291662, '[:fr]124 rue d\'assinie[:]', '12', NULL, NULL, NULL, NULL, '236', '238,237,236,235,234,233,232,231,230,229,228', 82000.00, 'instant', 7, 3, 2, 70.00, NULL, NULL, NULL, '[]', '28', '41,40,39,38,37,34,33,32,31', 'on', 1, '[:fr][:]', NULL, NULL, NULL, 'on', '[]', '', 25, 'publish', '2023-02-08 18:27:17', '2023-02-08 19:52:30', 'off', '', '[:fr][:]', '[]', NULL),
