(8, '[:en]Hair Care[:vi]New beauty service 1622011727[:ja]New beauty service 1622011727[:]', 'hair-care', '[:en]<p>Getting into a hair care routine is just like embarking on a skincare one. Once you’ve found one that works for you, you’ll rarely stray.</p><p>But the process of finding that routine can seem a little daunting, especially when there are numerous options for people with the same hair type.</p><p>We will advise and find the right hair care solution for you. Then we will take care of your hair so you have great hair.</p><p><br /></p><p><img src=\"http://ibooking.booteam.co/storage/2021/05/26/cec5513ceabd2b9e614026e8349aa26b-1622011066.jpg\"/></p><p><br /></p>[:vi][:ja][:]', 40.263881, -75.327830, '[:en]3043 Bainbridge Dr, Lansdale, PA 19446, USA[:vi][:ja][:]', '13', NULL, NULL, NULL, NULL, '226', '233,230,227,226', 12.00, 'instant', 'off', 5, '[:en][:vi][:ja][:]', NULL, NULL, 'on', '', 141, 1, 32400, 64800, 3600, 152, '', 1, 'publish', '2021-05-26 03:48:47', '2021-05-26 03:53:10', 'off', NULL, NULL, NULL),
