(10, '[:en]Facial Massage[:vi]New beauty service 1622017053[:ja]New beauty service 1622017053[:]', 'facial-massage', '[:en]<p><strong style=\"color: rgb(27, 26, 26);\">Facial massage instantly</strong><span style=\"color: rgb(27, 26, 26);\">&nbsp;calms your mind, slips you into de-stress mode and help you achieve impeccable and enviable skin. Not just that,&nbsp;</span><strong style=\"color: rgb(27, 26, 26);\">face massage benefits your skin</strong><span style=\"color: rgb(27, 26, 26);\">&nbsp;in many other ways as well. Facial massage tones your skin, brightens the complexion and slows down your ageing clock. If you didn’t know that, you’re not alone. You’ve been oblivious to the many benefits of facial massage for too long now and it is time you know how it does wonders for your skin. Read on to know all the&nbsp;</span><strong style=\"color: rgb(27, 26, 26);\">surprising benefits of face massage</strong><span style=\"color: rgb(27, 26, 26);\">&nbsp;and why you need to treat your skin with a stress-busting face massage RN...</span></p>[:vi][:ja][:]', 40.739152, -73.988298, '[:en]42 E 21st St, New York, NY 10010, USA[:vi][:ja][:]', '13', NULL, NULL, NULL, NULL, '244', '244,243,242,241', 30.00, 'instant', 'off', 5, '[:en][:vi][:ja][:]', NULL, NULL, 'on', '', 140, 2, 32400, 64800, 3600, 146, '', 1, 'publish', '2021-05-26 05:17:33', '2021-05-26 05:20:47', 'off', NULL, NULL, NULL),
