(12, '[:en]Foot waxing[:vi]New beauty service 1622018917[:ja]New beauty service 1622018917[:]', 'foot-waxing', '[:en]<p>When performing wax treatments day in, day out, it can become easy for therapists to slip into bad routines. In such a competitive field, this is enough to drive those customers away to your local competitors.</p><p>Reviewing and updating your processes is key if you want clients to return time and time again.&nbsp;We speak with the industry’s leading waxers to find out their trade secrets on keeping clients committed to your salon, from&nbsp;reward systems and extra touches, to the right communication,&nbsp;and round-up the best products to help you deliver a first-class service.</p><p><br /></p><p><img src=\"http://ibooking.booteam.co/storage/2021/05/26/loi-khuyen-huu-ich-ve-waxing-danh-cho-moi-co-gai-125393-1622019017.jpg\"/></p><p><br /></p>[:vi][:ja][:]', 40.739152, -73.988298, '[:en]42 E 21st St, New York, NY 10010, USA[:vi][:ja][:]', '13', NULL, NULL, NULL, NULL, '251', '252,251,250,249', 60.00, 'both', 'off', 5, '[:en][:vi][:ja][:]', NULL, NULL, 'off', '', 138, 3, 32400, 64800, 3600, 146, '', 1, 'publish', '2021-05-26 05:48:37', '2021-05-26 05:51:47', 'off', NULL, NULL, NULL),
