(3, 'EnVision Hotel Boston', 'envision-hotel-boston', '<p><span class=\"ql-cursor\">﻿</span>Conveniently located in Boston (MA), enVision Hotel Boston-Longwood an Ascend Hotel Col is a great base from which to explore this vibrant city. From here, guests can enjoy easy access to all that the lively city has to offer. No less exceptional is the hotel’s easy access to the city’s myriad attractions and landmarks, such as Children’s Hospital, Massart, Gasp.</p><p>First-rate hotel services and facilities that define the Choice Hotels experience await you at the enVision Hotel Boston-Longwood an Ascend Hotel Col. For the comfort and convenience of guests, the hotel offers Wi-Fi in public areas, pets allowed.</p><p>Experience high quality room facilities during your stay here. Some rooms include television LCD/plasma screen, air conditioning, heating, iPod docking station, internet access – LAN (complimentary), provided to help guests recharge after a long day. Besides, the hotel’s host of recreational offerings ensures you have plenty to do during your stay. Discover an engaging blend of professional service and a wide array of features at enVision Hotel Boston-Longwood an Ascend Hotel Col.</p>', 42.360500, -71.059600, 'Boston, MA, USA', '12', NULL, NULL, NULL, NULL, '127', '133,132,131,130,129', 200.00, '[]', 5, '134', '', 'a:2:{i:16166404415679;a:2:{s:5:\"title\";s:30:\"Conveniently located in Boston\";s:7:\"content\";s:371:\"Conveniently located in Boston (MA), enVision Hotel Boston-Longwood an Ascend Hotel Col is a great base from which to explore this vibrant city. From here, guests can enjoy easy access to all that the lively city has to offer. No less exceptional is the hotel’s easy access to the city’s myriad attractions and landmarks, such as Children’s Hospital, Massart, Gasp.\";}i:16166404929330;a:2:{s:5:\"title\";s:25:\"First-rate hotel services\";s:7:\"content\";s:247:\"First-rate hotel services and facilities that define the Choice Hotels experience await yo