(5, 'Sofitel Legend Metropole Hanoi', 'sofitel-legend-metropole-hanoi', '<p>A&nbsp;<strong style=\"background-color: initial;\">historic</strong>&nbsp;<strong style=\"background-color: initial;\">luxury</strong>&nbsp;landmark since 1901, Sofitel&nbsp;<strong style=\"background-color: initial;\">Legend Metropole</strong>&nbsp;offers pampering spa services, 24-hour room service and a heated swimming pool. It is located in central Hanoi, near the Old Quarter.</p><p>The 5-star Sofitel Legend Metropole is just 161 m from the famous Hanoi Opera House. The scenic Hoan Kiem Lake is less than 500 m from the hotel.</p><p>Still retaining the hotel’s original grandness, rooms feature either an elegant neo-classical theme or classic French decor. Fully air-conditioned, each room is equipped with free internet and a flat-screen TV.</p><p>Offering a blend of Eastern and Western therapies, guests can indulge with a massage and body treatment at Le Spa du Metropole. So Fit Fitness Center is well-equipped and provides exercise classes. The hotel also provides a business center and gift shop.</p><p>Housing a private dining room and outdoor terrace, Spices Garden serves Asian and Vietnamese specialties. Other dining options include Angelina, Hanoi\'s bespoke cocktail bar, whiskey lounge and restaurant and the first-ever French restaurant in Hanoi, Le Beaulieu.</p><p>This is our guests\' favorite part of Hanoi, according to independent reviews.</p><p>Couples in particular like the location – they rated it&nbsp;<strong>9.7</strong>&nbsp;for a two-person trip.</p><p>We speak your language!</p>', 21.028890, 105.852500, 'Hoan Kiem, Hanoi, Vietnam', '12', NULL, NULL, NULL, NULL, '113', '148,147,139,138,132', 150.00, '[]', 5, '134', '', 'a:5:{i:16166414311052;a:2:{s:5:\"title\";s:20:\"Very good experience\";s:7:\"content\";s:145:\"The 5-star Sofitel Legend Metropole is just 161 m from the famous Hanoi Opera House. The scenic Hoan Kiem Lake is less than 500 m from the hotel.\";}i:1616641437188