(6, '[:en]Riu Plaza Miami Beach[:vi]Riu Plaza Miami Beach[:ja]Riu Plaza Miami Beach[:]', 'riu-plaza-miami-beach', '[:en]<p>Located 160 metres’ walk from the beach, this Miami Beach hotel features an outdoor swimming pool and sun terrace. The hotel is 9 minutes’ drive from the shops and restaurants of Lincoln Road and offers free WiFi to guests.</p><p>A flat-screen TV, ironing facilities, and coffee-making facilities are available in Hotel Riu Plaza Miami Beach rooms. Private bathrooms feature a shower and hairdryer. Select rooms offer a sea view.</p><p>A fitness centre is available. This beachfront property offers bicycle hires, concierge services, and a 24-hour front desk. Dining options include a poolside snack bar and a buffet restaurant that features salads, fresh fruit, cheese plates, and more.</p><p>Guests can explore the waters, architecture, and nightlife of South Beach (3.6 km) or play a round of golf at Bayshore Golf Course (2.6 km). Miami Beach Convention Centre is 2.4 kilometres’ drive away while Miami International Airport is 17 minutes\' drive by car.</p>[:vi]<p>Located 160 metres’ walk from the beach, this Miami Beach hotel features an outdoor swimming pool and sun terrace. The hotel is 9 minutes’ drive from the shops and restaurants of Lincoln Road and offers free WiFi to guests.</p><p>A flat-screen TV, ironing facilities, and coffee-making facilities are available in Hotel Riu Plaza Miami Beach rooms. Private bathrooms feature a shower and hairdryer. Select rooms offer a sea view.</p><p>A fitness centre is available. This beachfront property offers bicycle hires, concierge services, and a 24-hour front desk. Dining options include a poolside snack bar and a buffet restaurant that features salads, fresh fruit, cheese plates, and more.</p><p>Guests can explore the waters, architecture, and nightlife of South Beach (3.6 km) or play a round of golf at Bayshore Golf Course (2.6 km). Miami Beach Convention Centre is 2.4 kilometres’ drive away while Miami 