(7, 'Fontainebleau Miami Beach', 'fontainebleau-miami-beach', '<p>Beachfront Fontainebleau Miami Beach features scenic ocean views and 6 outdoor swimming pools surrounded by private cabanas. A nightclub, 9 restaurants, and a spa are located on site for comfort.</p><p>A flat-screen TV and WiFi access come standard in every guestroom. Select rooms feature a kitchenette and a balcony with ocean views.</p><p>Enjoy music by the pools or relax in one of the private cabanas that include a flat-screen TV, WiFi, and butler service. There is also a children’s playground, children’s waterscape, and direct beach access.</p><p>Hotel Fontainebleau Miami Beach offers 9 dining establishments with a wide range of cuisines, including Chinese, Italian, and Japanese. Guests can enjoy oceanfront dining at La Cote or relax with coffee and cake at Chez Bon Bon.</p><p>Take a tour of the Art Deco District (3.4 mi drive) or enjoy the shops, restaurants, and sights of Lincoln Road Mall (3.1 mi drive). Miami International Airport is 20 minutes’ drive away.</p><p>Couples in particular like the location – they rated it&nbsp;<strong>8.6</strong>&nbsp;for a two-person trip.</p><p>We speak your language!</p>', 25.788299, -80.127754, 'Miami Beach, United States of America', '12', NULL, NULL, NULL, NULL, '149', '133,132,125,124,117,116', 300.00, '[]', 5, '134', '', '[]', '10:00', '13:00', 1, 1, 'a:4:{i:16166460393190;a:2:{s:5:\"title\";s:21:\"Miami Beach Golf Club\";s:8:\"distance\";s:6:\"2.4 km\";}i:16166461506665;a:2:{s:5:\"title\";s:18:\"Bass Museum of Art\";s:8:\"distance\";s:6:\"2.4 km\";}i:16166461574510;a:2:{s:5:\"title\";s:20:\"Bayshore Golf Course\";s:8:\"distance\";s:6:\"2.5 km\";}i:16166461692076;a:2:{s:5:\"title\";s:28:\"Miami Beach Botanical Garden\";s:8:\"distance\";s:6:\"2.9 km\";}}', '[]', '[]', 'a:4:{i:16166461774807;a:2:{s:5:\"title\";s:12:\"Lincoln Road\";s:8:\"distance\";s:6:\"3.3 km\";}i:16166461853024;a:2:{s:5:\"title\";s:15:\"Versace Mansion\";s:8:\"distance\";s:6:\"4.1 km\";}i