(9, 'Riu Plaza New York Times Square', 'riu-plaza-new-york-times-square', '<p>Located in New York, 100 m from Restaurant Row, Riu Plaza New York Times Square offers WiFi. The hotel has a terrace and fitness center, and guests can enjoy a meal at the restaurant The Theater Buffet.</p><p>All rooms have a TV. Every room is fitted with a private bathroom with a bath or shower, with free toiletries and a hair dryer provided.</p><p>There is a 24-hour front desk at the property and Capital Grab &amp; Go offers coffee.</p><p>Times Square is 400 m from Riu Plaza New York Times Square, while Broadway Theater is 601 m from the property. La Guardia Airport is 6.2 mi away.</p><p>This is our guests\' favorite part of New York, according to independent reviews.</p><p>Couples in particular like the location – they rated it&nbsp;<strong>9.5</strong>&nbsp;for a two-person trip.</p>', 40.755888, -73.980562, 'New York, United States of America', '12', NULL, NULL, NULL, NULL, '116', '128,125,122,117', 150.00, '[]', 4, '134', '', '[]', '10:00', '13:00', 1, 1, 'a:5:{i:16166538763091;a:2:{s:5:\"title\";s:14:\"Restaurant Row\";s:8:\"distance\";s:6:\"0.1 km\";}i:1616653881918;a:2:{s:5:\"title\";s:23:\"Richard Rodgers Theatre\";s:8:\"distance\";s:6:\"0.2 km\";}i:16166538881888;a:2:{s:5:\"title\";s:20:\"The Majestic Theatre\";s:8:\"distance\";s:6:\"0.2 km\";}i:16166538942982;a:2:{s:5:\"title\";s:16:\"Minskoff Theatre\";s:8:\"distance\";s:6:\"0.3 km\";}i:16166539001130;a:2:{s:5:\"title\";s:19:\"PlayStation Theater\";s:8:\"distance\";s:6:\"0.3 km\";}}', '[]', '[]', 'a:2:{i:16166539135842;a:2:{s:5:\"title\";s:18:\"Rockefeller Center\";s:8:\"distance\";s:6:\"0.9 km\";}i:16166539202745;a:2:{s:5:\"title\";s:20:\"Museum of Modern Art\";s:8:\"distance\";s:4:\"1 km\";}}', 'a:1:{i:1616653926991;a:2:{s:5:\"title\";s:26:\"Restaurant  Hell\'s Kitchen\";s:8:\"distance\";s:6:\"0.6 km\";}}', '[]', 'a:3:{i:16166539378727;a:2:{s:5:\"title\";s:17:\"LaGuardia Airport\";s:8:\"distance\";s:6:\"9.9 km\";}i:161665394