(10, 'EAST Miami', 'east-miami', '<p>With 4 pools, an on-site restaurant, and a 24-hour fitness center, there\'s something for everyone at EAST Miami. Located in Brickell City Center, EAST Miami offers premium retail shops, a movie theater, restaurants &amp; bars, spas, and more.</p><p>Rooms and suites offer elegant decor with modern accessories, including floor-to-ceiling windows, a walk-in rain shower, and complimentary WiFi for guests. Each accommodations houses a spacious balcony and en suite tea and coffee-making facilities. All rooms include 50-inch, flat-screen TVs.</p><p>The 20,000-square-foot outdoor pool deck features 4 unique pool experiences, which include a lap pool, spa pool, cold plunge, and hot tub.</p><p>Enjoy city views of Brickell from the 40th-level rooftop bar, Sugar, or explore the light snacks and beverage options of Domain lounge. Guests can taste authentic Uruguayan fares at East, Miami\'s 5th-level restaurant and bar, Quinto La Huella.</p><p>The exhibits of the Perez Art Museum Miami and the American Airlines Arena are within a 1.9 miles’ drive from the property. The shops, restaurants, and nightlife of South Beach are 15 minutes’ drive from EAST Miami. Miami International Airport is a 7.5 miles’ drive.</p>', 25.766833, -80.188727, 'Miami, United States of America', '12', NULL, NULL, NULL, NULL, '152', '153,152,151,150,149', 300.00, '[]', 3, '134', '', '[]', '10:00', '13:00', 1, 1, 'a:5:{i:16166543161724;a:2:{s:5:\"title\";s:20:\"Brickell City Centre\";s:8:\"distance\";s:6:\"0.2 km\";}i:16166543274604;a:2:{s:5:\"title\";s:12:\"HistoryMiami\";s:8:\"distance\";s:6:\"0.9 km\";}i:16166543337927;a:2:{s:5:\"title\";s:16:\"Miami Art Museum\";s:8:\"distance\";s:6:\"0.9 km\";}i:16166543389024;a:2:{s:5:\"title\";s:28:\"Miami-Dade County Courthouse\";s:8:\"distance\";s:6:\"0.9 km\";}i:16166543444754;a:2:{s:5:\"title\";s:34:\"Historical Museum of South Florida\";s:8:\"distance\";s:4:\"1 km\";}}', '[]', '[]', 'a:4:{i:16166543565431;a:2:{s:5:\"title\";s: