(11, 'Avanti International Resort', 'avanti-international-resort', '<p>Located in&nbsp;<strong style=\"background-color: initial;\">Orlando</strong>, Florida,&nbsp;<strong style=\"background-color: initial;\">Avanti Resort</strong>&nbsp;features an outdoor&nbsp;<strong style=\"background-color: initial;\">swimming pool</strong>, a&nbsp;<strong style=\"background-color: initial;\">poolside bar</strong>&nbsp;and grill, a barista in the lobby, and free property-wide WiFi. The Orange County Convention Center, home of the 2018 PGA Merchandise Show and the 2018 International Builders\' Show, is 1.7 km away.</p><p>A refrigerator and coffee machine come standard in each room at Avanti Resort as well as a private bathroom and flat-screen cable TV. Select rooms offer a microwave as well.</p><p>A fitness centre, volleyball court, and shuffleboard are featured at the Orlando hotel. Other facilities include a games room and vending machines.</p><p>Walt Disney World Resort is just 10 minutes’ drive from the Avanti. The Orlando Eye and Madame Tussauds are within 10 minutes\' walk of the hotel.</p><p>This is our guests\' favorite part of Orlando, according to independent reviews.</p><p>Couples in particular like the location – they rated it&nbsp;<strong>8.8</strong>&nbsp;for a two-person trip.</p><p>We speak your language!</p>', 28.470000, -81.470000, 'Orlando, United States of America', '12', NULL, NULL, NULL, NULL, '104', '141,139,133,132,130', 400.00, '[]', 2, '134', '', '[]', '10:00', '13:00', 1, 1, 'a:5:{i:16166552874237;a:2:{s:5:\"title\";s:20:\"Americas Escape Game\";s:8:\"distance\";s:6:\"0.2 km\";}i:16166552975746;a:2:{s:5:\"title\";s:28:\"Pirate\'s Cove Adventure Golf\";s:8:\"distance\";s:6:\"0.3 km\";}i:16166553029135;a:2:{s:5:\"title\";s:14:\"Icebar Orlando\";s:8:\"distance\";s:6:\"0.5 km\";}i:16166553074518;a:2:{s:5:\"title\";s:30:\"The Wheel at ICON Park Orlando\";s:8:\"distance\";s:6:\"0.6 km\";}i:16166553135489;a:2:{s:5:\"title\";s:19:\"Wonderworks Orlando\";s:8:\"d