(12, 'Grand Beach Hotel', 'grand-beach-hotel', '<p>Overlooking the Atlantic Ocean, this beachfront hotel features private beach access, a 7th-floor outdoor pool, and spacious suites. Grand Beach Hotel is 3.7 mi drive from South Beach.</p><p>Two 42-inch LCD TVs with free movies, a refrigerator, and a seating area are offered in every modernly-decorated Grand Beach Hotel suite. Most suites have a private balcony and 2 full bathrooms.</p><p>Hotel Grand Beach features 2 family-friendly, beachfront pools, hot tubs, and a 24-hour gym with panoramic view. Beach and pool-side spa services are available. Plus, a children\'s recreational area is on the 7th floor.</p><p>Chez Gaston Restaurant serves Latin and American cuisine throughout the day in a casual atmosphere. Guests can get drinks at any of the 3 bars including the poolside Sunset Bar.</p><p>Outdoor activities include snorkeling, windsurfing and deep sea fishing. Lincoln Road Mall is 3.5 mi drive from Hotel Grand Beach.</p><p>Couples in particular like the location – they rated it&nbsp;<strong>8.5</strong>&nbsp;for a two-person trip.</p><p>We speak your language!</p>', 25.788299, -80.127754, 'Miami, United States of America', '12', NULL, NULL, NULL, NULL, '129', '133,132,124,123', 250.00, '[]', 5, '134', '', '[]', '10:00', '13:00', 1, 1, 'a:3:{i:16166556523673;a:2:{s:5:\"title\";s:21:\"Miami Beach Golf Club\";s:8:\"distance\";s:4:\"3 km\";}i:16166556631911;a:2:{s:5:\"title\";s:18:\"Bass Museum of Art\";s:8:\"distance\";s:6:\"3.2 km\";}i:16166556688099;a:2:{s:5:\"title\";s:20:\"Bayshore Golf Course\";s:8:\"distance\";s:6:\"3.2 km\";}}', '[]', '[]', 'a:3:{i:16166556803416;a:2:{s:5:\"title\";s:12:\"Lincoln Road\";s:8:\"distance\";s:6:\"4.1 km\";}i:16166556842677;a:2:{s:5:\"title\";s:15:\"Versace Mansion\";s:8:\"distance\";s:6:\"4.8 km\";}i:16166556897030;a:2:{s:5:\"title\";s:26:\"Art Deco Historic District\";s:8:\"distance\";s:6:\"5.1 km\";}}', '[]', '[]', 'a:3:{i:16166556955930;a:2:{s:5:\"title\";s:19:\"Miami Seaplane B