(74, '[:fr]Hôtel Grand Sud[:]', 'hotel-grand-sud', '[:fr]<p>Situé à Abidjan, le Radisson Blu Hotel, Abidjan Airport propose un hébergement, une piscine extérieure ouverte toute l\'année et un restaurant.</p><p>Vous profiterez d\'une vue sur la ville.</p><p>Les chambres comprennent une télévision par satellite à écran plat. Certaines comportent un coin salon. Par ailleurs, le Radisson Blu Hotel,Abidjan Airport met gratuitement à votre disposition une connexion Wi-Fi dans l\'ensemble de son enceinte.</p><p>L\'aéroport d\'Abdjan se trouve à moins de 10 minutes en voiture. Un service de navette gratuit est assuré.</p><p>Les couples apprécient particulièrement l\'emplacement de cet établissement. Ils lui donnent la note de&nbsp;<strong>8,3</strong>&nbsp;pour un séjour à deux.</p>[:]', 5.320357, -4.016107, '[:fr]Route de l\'aéroport d\'Abidjan, BP 2176 Abidjan 03, Abidjan, Côte-d\'Ivoire[:]', '12', NULL, NULL, NULL, NULL, '51', '52,51,50,49,48,47,46,45,44,43,42,41,40,39,38', 150000.00, '[]', 5, '50', '', 'a:1:{i:16748230246280;a:2:{s:5:\"title\";s:38:\"[:fr]Conditions de l\'établissement[:]\";s:7:\"content\";s:1761:\"[:fr]Le REP est un recours administratif réalisé devant une juridiction administrative contre tout acte administratif et qui a pour effet d’assurer le respect de la légalité. C’est un principe général du droit dégagé par l’arrêt du Conseil d’Etat Dame Lamotte le 17 février 1950. En résumé, le REP est une procédure qui permet d’attaquer un acte administratif comme arrêté préfectoral ou un décret.\r\n\r\nPour se faire, l’on doit démontrer qu’il y’a un problème de légalité, soit interne, soit externe. En effet, la légalité externe renvoie à plusieurs moyens parmi lesquels l’on a l’incompétence de la personne qui a pris l’acte, par exemple un maire qui prend une décision portant sur une commune voisine. Il y’a aussi le vice de forme ou de procédure qui renvoie au fait qu’une formalité importante a été omise ou la procédure n’a pas été suivie convenablement. \r\n\r\nPour la légalité interne, les possibilités sont tout d’abord, la violation de la loi, c’est-à-dire l’administration n’a pas respecté le texte applicable ou elle ne l’a pas tout simplement pas appliqué. On parle souvent ici d’erreur de droit ou de fait, et le détournement de pouvoir ou de procédure qui renvoie à l’idée que l’administration a usé d’un pouvoir dont elle ne disposait pas pour prendre la décision contestée.\r\n\r\nAprès avoir exercé son contrôle, le juge administratif décide dans le cadre du REP d’annuler la décision administrative litigieuse. Cette décision disparaît rétroactivement de l’ordre juridique, cela revient à dire que tout doit se passer comme si cet acte administratif n’avait jamais existé et ses effets produits antérieurement au jugement sont annulés.[:]\";}}', '12h00', '11h00', 1, 1, '[]', '[]', '[]', '[]', '[]', '[]', '[]', '[]', 'on', 1, '[:fr]Vous pouvez annuler votre réservation 24h avant votre date d\'arrivée. Dépasser ce détail, aucune annulation n\'est pas possible.[:]', '167', '76,75,74,73,72,71,69', '85,84,81,78,77', NULL, 'on', 21, 'publish', '2023-01-27 18:30:12', '2023-01-27 18:50:54', 'both', 'off', '', '[:fr][:]', NULL, NULL),
