(76, '[:fr]Hôtel Paradis[:]', 'hotel-paradis-1', '[:fr]<p>Situé à Abidjan, le Radisson Blu Hotel, Abidjan Airport propose un hébergement, une piscine extérieure ouverte toute l\'année et un restaurant. Vous profiterez d\'une vue sur la ville.</p><p>Les chambres comprennent une télévision par satellite à écran plat. Certaines comportent un coin salon. Par ailleurs, le Radisson Blu Hotel, Abidjan Airport met gratuitement à votre disposition une connexion Wi-Fi dans l\'ensemble de son enceinte.</p><p>L\'aéroport d\'Abdjan se trouve à moins de 10 minutes en voiture. Un service de navette gratuit est assuré.</p><p>Les couples apprécient particulièrement l\'emplacement de cet établissement. Ils lui donnent la note de <strong>8,3</strong> pour un séjour à deux.</p>[:]', 5.320357, -4.016107, '[:fr]Bordure lagunaire[:]', '12', NULL, NULL, NULL, NULL, '56', '64,63,62,61,60,58,57,56,55,54', 85000.00, '[]', 3, '53', '', 'a:1:{i:16748302243462;a:2:{s:5:\"title\";s:38:\"[:fr]Conditions de l\'établissement[:]\";s:7:\"content\";s:925:\"[:fr]Le REP est un recours administratif réalisé devant une juridiction administrative contre tout acte administratif et qui a pour effet d’assurer le respect de la légalité. C’est un principe général du droit dégagé par l’arrêt du Conseil d’Etat Dame Lamotte le 17 février 1950. En résumé, le REP est une procédure qui permet d’attaquer un acte administratif comme arrêté préfectoral ou un décret.\r\n\r\nPour se faire, l’on doit démontrer qu’il y’a un problème de légalité, soit interne, soit externe. En effet, la légalité externe renvoie à plusieurs moyens parmi lesquels l’on a l’incompétence de la personne qui a pris l’acte, par exemple un maire qui prend une décision portant sur une commune voisine. Il y’a aussi le vice de forme ou de procédure qui renvoie au fait qu’une formalité importante a été omise ou la procédure n’a pas été suivie convenablement.[:]\";}}', '12h00', '11h00', 1, 1, '[]', '[]', '[]', '[]', '[]', '[]', '[]', '[]', 'off', 5, '[:fr]