(77, '[:fr]Hôtel de la Présidence[:]', 'hotel-de-la-presidence', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">Un endroit féerique idéal pour vous réunir, le splendide chalet les 3 Oursons surplombe la ville avec une magnifique vue sur Gérardmer à proximité de la station de ski de la Mauselaine.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Sur 3 niveaux, avec une surface de 254m², le chalet les 3 oursons bénéficie de 6 chambres, WC, 3 salles de bains</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au niveau principal : Une entrée spacieuse, un grand salon séjour avec cheminée donnant sur une cuisine américaine toute équipée (2 appareils à raclette et 2 appareils à fondue font aussi partie des équipements fournis), un WC, une chambre avec salle de bain privative et WC. Le salon séjour donne également accès à une grande et spacieuse terrasse avec table de Banquet et une plancha à gaz.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au 1er étage, 3 chambres doubles, une salle de bain spacieuse avec douche à l\'italienne, un WC.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Rez de Jardin, 2 chambres (pour 4 personnes), une grande salle de bain avec douche à l\'italienne et Sauna, une salle de jeu avec Air Hockey et Baby foot, un accès terrasse extérieur avec solarium et Jacuzzi.</span></p>[:]', 6.809107, -5.273263, '[:fr]1 Avenue de la République[:]', '12', NULL, NULL, NULL, NULL, '129', '130,129,128,127,126,125,124,123,122,121', 90000.00, '[]', 5, '', '', 'a:1:{i:16749120663023;a:2:{s:5:\"title\";s:22:\"[:fr]Nos conditions[:]\";s:7:\"content\";s:343:\"[:fr]L’assemblée générale du Conseil d’Etat peut être présidée par le 1er ministre. Mais en pratique et pour l’ensemble des missions de cette juridiction, la présidence est assurée par un vice-président assisté de 7 présidents de section et d’un secrétaire général. Le Conseil d’Etat siège au Palais Royal à Paris.[:]\";}}', '13h', '12h', 0, 1, '[]', '[]', '[]', '[]', '[]', '[]', '[]', '[]', 'off', 5, '[:fr][:]', '167', '76,75,74,73,72,71,69', '85,84,82,81,80,77', NULL, 'on', 17, 'publish', '2023-01-28 19:16:51', '2023-01-29 02:44:05', 'both', 'off', '', '[:fr][:]', NULL, NULL),
