(79, '[:fr]Hôtel La sirène[:]', 'hotel-la-sirene', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">\"Le Bas Fort Blanc\" est située sur l\'extrémité du Front de mer de Dieppe, côté Château de Dieppe.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Le Front de mer est un espace dynamique grâce aux diverses activités estivales organisées sur ses larges pelouses, comme le Festival International du Cerf-Volant, la fête foraine en été, activités sportives gratuites... De plus, vous y trouverez une piscine eau de mer chauffée avec centre de thalassothérapie, le Casino de Dieppe, le café Epson, le Château de Dieppe édifié dès le XIVe siècle, parc pour enfants et skate-parc, divers kiosques à glaces, chichi, crêpes...</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">L\'appartement est à 5 min à pied de la Grande Rue de Dieppe, où vous trouverez commerces, Grand marché du samedi (élu meilleur marché 2020 par TF1) etc.</span></p><p><span style=\"color: rgb(34, 34, 34);\">De plus, le restaurant \"Le Bas Fort Blanc\" et le Café \"Le Bar O Mètre\" sont à proximité du logement.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">La gare de Dieppe est à 15 min à pied de l\'appartement. Quant aux véhicules, ils peuvent stationner gratuitement tout le long du front de mer.</span></p>[:]', 5.135077, -3.291662, '[:fr]12 plage d\'assinie[:]', '12', NULL, NULL, NULL, NULL, '193', '198,197,196,195,194,193,192,191,190,189,188,187,186', 180000.00, '[]', 5, '', '', NULL, '12h00', '11h00', 2, 1, '[]', '[]', '[]', '[]', '[]', '[]', '[]', '[]', NULL, NULL, NULL, '167', '173,76,75,74,73,69', '85,83,82,78', NULL, 'on', 19, 'publish', '2023-01-29 02:14:45', '2023-01-29 02:49:59', 'both', 'off', '', '[:fr][:]', NULL, NULL),
