(87, '[:fr]Hôtel Miroir d\'or[:]', 'hotel-miroir-dor', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">Notre logement est situé dans un ancien corps de ferme, où nous avons créé 3 logements avec terrasse complètement indépendant (L\'Oxalis villas).</span></p><p><span style=\"color: rgb(34, 34, 34);\">Vous serez complètement indépendant au calme avec pour unique bruit le sifflement des oiseaux.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Le studio est situé dans un hameau de charme au beau milieu de la forêt.</span></p><p><span style=\"color: rgb(34, 34, 34);\">A deux pas du logement, de nombreuses balades vous attendent.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Vous pourrez aussi faire du sport, ou tout simplement vous ressourcer.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Les gros plus de ce logement :</span></p><p><span style=\"color: rgb(34, 34, 34);\">La literie (haut de gamme)</span></p><p><span style=\"color: rgb(34, 34, 34);\">La balnéothérapie</span></p><p><span style=\"color: rgb(34, 34, 34);\">La terrasse</span></p><p><span style=\"color: rgb(34, 34, 34);\">L\'emplacement en pleine nature</span></p><p><span style=\"color: rgb(34, 34, 34);\">Les équipements (ambiance lumière tamisé, choix de la couleur, Bluetooth pour mettre sa musique dans la chambre ou dans la balnéothérapie)</span></p><p><span style=\"color: rgb(34, 34, 34);\">La télévision est connectée à un lecteur de DVD, pas de chaîne (déconnexion totale)</span></p>[:]', 5.135077, -3.291662, '[:fr]1245 rue Géorges 5[:]', '12', NULL, NULL, NULL, NULL, '220', '227,226,225,224,223,222,221,220,219,218,217,216', 130000.00, '[]', 3, '', '', '[]', '12h00', '11h00', 1, 1, '[]', '[]', '[]', '[]', '[]', '[]', '[]', '[]', 'off', 5, '[:fr][:]', '167', '173,76,75,74,73,69', '85,84,81', NULL, 'on', 25, 'publish', '2023-02-08 18:11:51', '2023-02-08 19:52:01', 'both', 'off', '', '[:fr][:]', NULL, NULL),
