(12, '[:fr]À propos[:]', 'a-propos', '[:fr]<p>Bienvenue chez SHAP AFRICA, une entreprise qui apporte une nouvelle vision du tourisme en Afrique. Notre continent regorge de merveilles naturelles, de cultures uniques et de patrimoines précieux, mais il a longtemps souffert de la sous-valorisation de son potentiel touristique. Pour pallier ce dilemme, nous avons créé SHAP AFRICA.</p><p>SHAP AFRICA est une plateforme en ligne de réservation d’hébergements touristiques dédiée à la valorisation du tourisme africain. Elle facilite la découverte et la réservation de logements de qualité, allant des hôtels aux appartements en passant par les villas et les salles événementielles, dans tout le continent. Nous travaillons en étroite collaboration avec les propriétaires d\'hébergements pour soutenir les entreprises locales et encourager la croissance économique du secteur touristique.</p><p>En choisissant SHAP AFRICA, vous bénéficiez d\'une expérience de voyage inoubliable et contribuez à valoriser le tourisme en Afrique. Grâce à des moyens de paiement électronique standard y compris le Mobile Money, notre géolocalisation des hébergements touristiques et la possibilité de réserver un hébergement instantanément 24h/24, nous offrons une expérience de voyage sans stress et sans tracas à nos clients.</p><p>Rejoignez-nous pour découvrir l\'Afrique de manière unique avec SHAP AFRICA.</p>[:]', '', 'publish', 1, '2023-01-19 00:32:09', '2023-01-30 07:27:48', NULL),
