INSERT INTO `gmz_room` (`id`, `post_title`, `post_content`, `thumbnail_id`, `gallery`, `base_price`, `number_of_room`, `room_footage`, `number_of_bed`, `number_of_adult`, `number_of_children`, `room_facilities`, `hotel_id`, `author`, `status`, `created_at`, `updated_at`, `ical`, `deleted_at`) VALUES
(1, 'Deluxe City View King Room', '<p>Located 525 feet’ walk from the beach, this Miami Beach hotel features an outdoor swimming pool and sun terrace. The hotel is 9 minutes’ drive from the shops and restaurants of Lincoln Road and offers free WiFi to guests.</p><p>A flat-screen TV, ironing facilities, and coffee-making facilities are available in Hotel Riu Plaza Miami Beach rooms. Private bathrooms feature a shower and hairdryer. Select rooms offer a sea view.</p>', '131', '133,132,131,130,129', 400.00, 10, 450.00, 2, 4, 5, '97,96,94,92,91,90,87,86', 6, 1, 'publish', '2021-03-25 01:15:11', '2021-03-25 02:09:59', NULL, NULL),
(2, 'Standard Double Room', '<p>Standard Double Room comprises of 1 Double Bed or 2 Twin Beds, 2 Bedside Tables, a Desk &amp; Chair. The room is furnished with wall to wall carpeting, trendy furnishings and a balcony.</p>', '130', '133,132,131,130', 200.00, 10, 50.00, 2, 3, 4, '97,96,95,94,93,92,91,90,89,88,87,86', 3, 1, 'publish', '2021-03-25 01:52:11', '2021-03-25 01:53:40', NULL, NULL),
(3, 'Single Room', '<p><span style=\"color: rgb(33, 37, 41);\">Experience high quality room facilities during your stay here. Some rooms include television LCD/plasma screen, air conditioning, heating, iPod docking station, internet access – LAN (complimentary), provided to help guests recharge after a long day. Besides, the hotel’s host of recreational offerings ensures you have plenty to do during your stay. Discover an engaging blend of professional service and a wide array of features at enVision Hotel Boston-Longwood an Ascend Hotel Col.</span></p>', '121', '133,125,124,123', 150.00, 10, 35.00, 3, 3, 3, '97,96,94,93,91,90,88', 3, 1, 'publish', '2021-03-25 01:53:57', '2021-03-25 01:54:39', NULL, NULL),
(4, 'Standard Double Room', '<p><span style=\"color: rgb(94, 109, 119);\">Built in 1986, Hotel Stanford is a distinct addition to New York (NY) and a smart choice for travelers. The excitement of the city center is only 0 KM away. No less exceptional is the hotel’s easy access to the city’s myriad attractions and landmarks, such as Toto Music Studio, British Virgin Islands Tourist Board</span></p>', '125', '118,117,116,115', 399.00, 10, 60.00, 1, 2, 3, '97,95,94,92,91,89,88,86', 4, 1, 'publish', '2021-03-25 01:55:49', '2021-03-25 01:56:52', NULL, NULL),
(5, 'Room Kerama Islands', '<p><span style=\"color: rgb(94, 109, 119);\">Built in 1986, Hotel Stanford is a distinct addition to New York (NY) and a smart choice for travelers. The excitement of the city center is only 0 KM away. No less exceptional is the hotel’s easy access to the city’s myriad attractions and landmarks, such as Toto Music Studio, British Virgin Islands Tourist Board</span></p>', '117', '128,127,126,125', 250.00, 10, 25.00, 2, 3, 4, '95,94,93,92,91,90,88,87', 4, 1, 'publish', '2021-03-25 01:57:10', '2021-03-25 01:57:54', NULL, NULL),
(6, 'Double Room With Town View', '<p><span style=\"color: rgb(94, 109, 119);\">Built in 1986, Hotel Stanford is a distinct addition to New York (NY) and a smart choice for travelers. The excitement of the city center is only 0 KM away. No less exceptional is the hotel’s easy access to the city’s myriad attractions and landmarks, such as Toto Music Studio, British Virgin Islands Tourist Board, L’Atelier Du Chocolat. Start and end in San Francisco! With the in-depth cultural tour Northern California Summer 2019, you have a 8 day tour package taking you through San Francisco, USA and 9 other destinations in USA. Northern California Summer 2019 includes accommodation as well as an expert guide, meals, transport and more.</span></p>', '118', '129,123,122,121', 300.00, 10, 25.00, 1, 2, 3, '97,96,95,94,93,92,90,87', 4, 1, 'publish', '2021-03-25 01:58:05', '2021-03-25 01:58:47', NULL, NULL),
(7, 'Opera Wing - Premium Twin Room', '<p><span style=\"color: rgb(51, 51, 51);\">Features bright interiors fitted with elegant timber flooring, a modern bathroom, and facilities like a flat screen TV, free Wi-Fi and wired internet.</span></p><p><br /></p><p><span style=\"color: rgb(51, 51, 51);\">This room type cannot accommodate an extra bed or a crib. Guests enjoy: - 30% off on spa</span></p>', '107', '117,116,115,114', 150.00, 10, 32.00, 2, 3, 4, '97,95,94,92,91,90,88,87', 5, 1, 'publish', '2021-03-25 02:01:26', '2021-03-25 02:02:12', NULL, NULL),
(8, 'Historical Wing - Luxury Twin Room', '<p><span style=\"color: rgb(51, 51, 51);\">Elegant rooms feature decor distinctive of 1920s France, natural wooden flooring, a flat screen TV and free Wi-Fi and wired internet.</span></p><p><br /></p><p><span style=\"color: rgb(51, 51, 51);\">This room type cannot accommodate an extra bed or a crib. Guests enjoy: - 30% off on spa</span></p>', '106', '120,119,118,117', 100.00, 10, 32.00, 3, 4, 5, '97,94,93,91,90,89,87,86', 5, 1, 'publish', '2021-03-25 02:06:53', '2021-03-25 02:08:00', NULL, NULL),
(9, 'Opera Wing - Premium Double Room', '<p><span style=\"color: rgb(51, 51, 51);\">Lofty and bright interiors are fitted with elegant timber flooring. Features a modern bathroom, flat screen TV and free Wi-Fi and wired internet.</span></p><p><br /></p><p><span style=\"color: rgb(51, 51, 51);\">This room type cannot accommodate an extra bed or a crib. Guests enjoy: - 30% off on spa</span></p>', '110', '120,119,118,117', 120.00, 10, 32.00, 1, 2, 3, '97,96,94,93,91,90,89,88', 5, 1, 'publish', '2021-03-25 02:08:11', '2021-03-25 02:09:04', NULL, NULL),
(11, 'Deluxe City View with Two Double Beds', '<p><span style=\"color: rgb(51, 51, 51);\">This spacious double room has air conditioning and offers city views.</span></p>', '112', '112,111,110,109,108', 500.00, 10, 300.00, 3, 4, 5, '97,96,95,94,93,92,91,90,89,88,87,86', 6, 1, 'publish', '2021-03-25 02:10:30', '2021-03-25 02:11:30', NULL, NULL),
(12, 'Deluxe Ocean View King Room', '<p><span style=\"color: rgb(51, 51, 51);\">This double room features a balcony, air conditioning and flat-screen TV.</span></p>', '105', '120,119,117,112,110', 300.00, 10, 120.00, 3, 4, 5, '97,96,95,94,93,92,91,90,89,88,87,86', 6, 1, 'publish', '2021-03-25 02:11:40', '2021-03-25 02:13:56', NULL, NULL),
(13, 'Tresor Bay View Junior Suite', '<p>This room offers an extra large bed and spacious sitting area equipped with a 32-inch LCD TV, iPod docking station and work desk. The marble bathroom features a bathtub or shower and includes a bathrobe and toiletries.</p><p><br /></p>', '107', '128,127,124,120,119,115', 300.00, 10, 46.00, 3, 4, 5, '97,96,94,93,91,90', 7, 1, 'publish', '2021-03-25 02:26:14', '2021-03-25 02:26:51', NULL, NULL),
(14, 'Standard Room with King Bed', '<p>This room with carpeted floors features a flat-screen TV, iPod docking station and bathroom with bathtub or shower. A bathrobe and toiletries are included.</p><p><br /></p>', '106', '133,130,128,124,122,121', 250.00, 10, 28.00, 1, 1, 1, '97,96,95,94,93,90', 7, 1, 'publish', '2021-03-25 02:27:00', '2021-03-25 02:27:41', NULL, NULL),
(15, 'Deluxe King Room with Balcony', '<p>In the Landmark Fontainebleau Chateau or Versailles buildings, this room includes a balcony. It comes with a flat-screen TV and iPod docking station. Bathroom amenities include a bathrobe and toiletries.</p><p><br /></p>', '117', '126,124,122,120,116', 200.00, 10, 30.00, 1, 1, 1, '97,96,94,93,89,86', 7, 1, 'publish', '2021-03-25 02:27:54', '2021-03-25 02:28:41', NULL, NULL),
(16, 'Deluxe Queen Room', '<p>This double room has air conditioning and satellite TV.</p><p><br /></p>', '121', '127,126,125,118', 150.00, 10, 18.00, 2, 3, 4, '97,96,95,94,93,92,91,90,89,88,87,86', 9, 1, 'publish', '2021-03-25 04:34:02', '2021-03-25 04:34:44', NULL, NULL),
(17, 'Deluxe King Room', '<p>This double room has a satellite TV and air conditioning.</p><p><br /></p>', '128', '128,127,126,125', 140.00, 10, 18.00, 1, 2, 3, '97,96,94,93,91,90', 9, 1, 'publish', '2021-03-25 04:35:07', '2021-03-25 04:35:48', NULL, NULL),
(18, 'Deluxe Double Room with Two Double Beds', '<p>This quadruple room features air conditioning and view.</p><p><br /></p>', '112', '119,118,117,116,115', 120.00, 10, 23.00, 1, 1, 1, '97,96,95,94,93,92,91,90,89,88,87,86', 9, 1, 'publish', '2021-03-25 04:36:11', '2021-03-25 04:36:47', NULL, NULL),
(19, 'Urban King Room', '<p>The Urban King Room includes a full-sized work desk, content streaming, and a fully stocked mini-bar. Additional luxuries include floor-to-ceiling windows, bath amenities, and spacious balconies that offers views of Brickell and Miami city center.</p><p><br /></p>', '105', '128,127,126,120,119', 300.00, 10, 33.00, 2, 3, 4, '97,96,95,94,93,92,91,90,89', 10, 1, 'publish', '2021-03-25 04:50:11', '2021-03-25 04:51:19', NULL, NULL),
(20, 'Urban Room with Two Double Beds', '<p>The Urban Double Room features floor-to ceiling windows, city and bay views, and en suite content streaming via the 50-inch smart TV. The room includes energy-efficient options as well as luxury bath amenities and free WiFi.</p><p><br /></p>', '107', '122,121,116,115,114,113', 250.00, 10, 28.00, 1, 1, 1, '97,96,95,94,93,92,91,90,89,88', 10, 1, 'publish', '2021-03-25 04:51:30', '2021-03-25 04:52:06', NULL, NULL),
(21, 'Corner King Room', '<p>The Corner King Room features a wrap-around balcony, floor-to-ceiling windows, and city views. The room includes energy-efficient options as well as a spacious, five-foot bath.</p><p><br /></p>', '112', '148,147,138,132,131,130', 280.00, 10, 38.00, 1, 1, 1, '97,95,94,92,90,87', 10, 1, 'publish', '2021-03-25 04:52:16', '2021-03-25 04:52:49', NULL, NULL),
(22, 'Bay King Room', '<p>The Bay King Room features a wrap-around balcony, free WiFi, and floor-to-ceiling windows that highlight Key Biscayne and the Port of Miami. Guests can stream content on the 50-inch smart TV or unwind with en suite bath amenities.</p><p><br /></p>', '148', '150,148,138,130', 220.00, 10, 38.00, 1, 1, 1, '97,94,93,90,89,86', 10, 1, 'publish', '2021-03-25 04:52:56', '2021-03-25 04:53:32', NULL, NULL),
(23, 'Deluxe King Room', '<p>This room features a refrigerator, coffee machine, and flat-screen cable TV.</p><p><br /></p>', '148', '153,152,151,150,149', 400.00, 10, 33.00, 2, 3, 4, '97,94,93,91,90,89,88,87,86', 11, 1, 'publish', '2021-03-25 04:57:12', '2021-03-25 04:57:47', NULL, NULL),
(24, 'Deluxe Queen Room with Two Queen Beds', '<p>This room features a refrigerator, coffee machine, and flat-screen cable TV.</p><p><br /></p>', '120', '133,132,131,130,129', 350.00, 10, 33.00, 1, 1, 1, '97,94,92,90,89,87', 11, 1, 'publish', '2021-03-25 04:58:03', '2021-03-25 04:58:37', NULL, NULL),
(25, 'Superier King Room with Pool View', '<p>This room features a refrigerator, coffee machine, and flat-screen cable TV.</p><p><br /></p>', '150', '151,150,132,131,130,123', 300.00, 10, 33.00, 1, 1, 1, '96,94,92,91,89,87', 11, 1, 'publish', '2021-03-25 04:58:45', '2021-03-25 04:59:21', NULL, NULL),
(26, 'King Suite with Pool View', '<p><span style=\"color: rgb(51, 51, 51);\">Overlooking the pool, this king suite includes two 42-inch flat-screen TVs, a private balcony, and coffee-making facilities.</span></p><p><br /></p><p><span style=\"color: rgb(51, 51, 51);\">Please note that the room rate is based on 2 guests. Maximum occupancy is 4 guests (see Hotel Policies)</span></p>', '130', '132,131,130,129', 250.00, 10, 41.00, 1, 1, 1, '97,96,94,93,91,88', 12, 1, 'publish', '2021-03-25 05:03:25', '2021-03-25 05:03:54', NULL, NULL),
(27, 'King Suite with Bay View', '<p><span style=\"color: rgb(51, 51, 51);\">Overlooking Biscayne Bay, this king suite includes a sofa bed, balcony, and 1 full bathroom. Two 42-inch flat-screen TVs are provided.</span></p><p><br /></p><p><span style=\"color: rgb(51, 51, 51);\">Please note that the room rate is based on 2 guests. Maximum occupancy is 4 guests (see Hotel Policies)</span></p>', '120', '118,117,116,115,114', 200.00, 10, 41.00, 1, 1, 1, '94,91,90,89,87,86', 12, 1, 'publish', '2021-03-25 05:04:00', '2021-03-25 05:04:31', NULL, NULL),
(28, 'King Suite with Partial Ocean View', '<p><span style=\"color: rgb(51, 51, 51);\">This suite faces either north or south and provides partial views of the Atlantic Ocean.</span></p><p><br /></p><p><span style=\"color: rgb(51, 51, 51);\">Please note that the room rate is based on 2 guests. Maximum occupancy is 4 guests (see Hotel Policies)</span></p>', '127', '145,141,140,132', 200.00, 10, 38.00, 1, 1, 1, '97,96,95,94,93,92,91,90,89,88,87,86', 12, 1, 'publish', '2021-03-25 05:04:38', '2021-03-25 05:05:12', NULL, NULL),
