(37, '[:fr]Chambre de luxe[:]', '[:fr]<p>Situé à Abidjan, le Radisson Blu Hotel, Abidjan Airport propose un hébergement, une piscine extérieure ouverte toute l\'année et un restaurant. Vous profiterez d\'une vue sur la ville.</p><p>Les chambres comprennent une télévision par satellite à écran plat. Certaines comportent un coin salon. Par ailleurs, le Radisson Blu Hotel,</p><p>Abidjan Airport met gratuitement à votre disposition une connexion Wi-Fi dans l\'ensemble de son enceinte.</p><p>L\'aéroport d\'Abdjan se trouve à moins de 10 minutes en voiture. Un service de navette gratuit est assuré.</p><p>Les couples apprécient particulièrement l\'emplacement de cet établissement. Ils lui donnent la note de <strong>8,3</strong> pour un séjour à deux.</p>[:]', '50', '50,47,44', 100000.00, 1, 65.00, 1, 2, 1, '95,94,93,92,91,90,89,88,86', 74, 21, 'publish', '2023-01-27 18:40:29', '2023-01-27 18:53:45', '[]', NULL),
(38, '[:fr]Chambre duplex[:]', '[:fr]<p>Situé à Abidjan, le Radisson Blu Hotel, Abidjan Airport propose un hébergement, une piscine extérieure ouverte toute l\'année et un restaurant. Vous profiterez d\'une vue sur la ville.</p><p>Les chambres comprennent une télévision par satellite à écran plat. Certaines comportent un coin salon. Par ailleurs, le Radisson Blu Hotel, Abidjan Airport met gratuitement à votre disposition une connexion Wi-Fi dans l\'ensemble de son enceinte.</p><p>L\'aéroport d\'Abdjan se trouve à moins de 10 minutes en voiture. Un service de navette gratuit est assuré.</p><p>Les couples apprécient particulièrement l\'emplacement de cet établissement. Ils lui donnent la note de&nbsp;<strong>8,3</strong>&nbsp;pour un séjour à deux.</p>[:]', '44', '50,47,44', 130000.00, 4, 52.00, 1, 2, 0, '95,94,93,92,91,90,89,88,87,86', 74, 21, 'publish', '2023-01-27 18:44:40', '2023-01-27 18:48:47', '[]', NULL),
