(41, '[:fr]Suite présidentielle[:]', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">Un endroit féerique idéal pour vous réunir, le splendide chalet les 3 Oursons surplombe la ville avec une magnifique vue sur Gérardmer à proximité de la station de ski de la Mauselaine.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Sur 3 niveaux, avec une surface de 254m², le chalet les 3 oursons bénéficie de 6 chambres, WC, 3 salles de bains</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au niveau principal : Une entrée spacieuse, un grand salon séjour avec cheminée donnant sur une cuisine américaine toute équipée (2 appareils à raclette et 2 appareils à fondue font aussi partie des équipements fournis), un WC, une chambre avec salle de bain privative et WC. Le salon séjour donne également accès à une grande et spacieuse terrasse avec table de Banquet et une plancha à gaz.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au 1er étage, 3 chambres doubles, une salle de bain spacieuse avec douche à l\'italienne, un WC.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Rez de Jardin, 2 chambres (pour 4 personnes), une grande salle de bain avec douche à l\'italienne et Sauna, une salle de jeu avec Air Hockey et Baby foot, un accès terrasse extérieur avec solarium et Jacuzzi.</span></p>[:]', '129', '130,129,128,127,126,125,124,123,122,121', 250000.00, 1, 55.00, 1, 2, 0, '96,95,94,93,92,91,90,89,88,87,86', 77, 17, 'publish', '2023-01-28 19:26:24', '2023-01-28 19:28:41', '[]', NULL),
