(45, '[:fr]Chambre face plage[:]', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">\"Le Bas Fort Blanc\" est située sur l\'extrémité du Front de mer de Dieppe, côté Château de Dieppe.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Le Front de mer est un espace dynamique grâce aux diverses activités estivales organisées sur ses larges pelouses, comme le Festival International du Cerf-Volant, la fête foraine en été, activités sportives gratuites... De plus, vous y trouverez une piscine eau de mer chauffée avec centre de thalassothérapie, le Casino de Dieppe, le café Epson, le Château de Dieppe édifié dès le XIVe siècle, parc pour enfants et skate-parc, divers kiosques à glaces, chichi, crêpes...</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">L\'appartement est à 5 min à pied de la Grande Rue de Dieppe, où vous trouverez commerces, Grand marché du samedi (élu meilleur marché 2020 par TF1) etc.</span></p><p><span style=\"color: rgb(34, 34, 34);\">De plus, le restaurant \"Le Bas Fort Blanc\" et le Café \"Le Bar O Mètre\" sont à proximité du logement.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">La gare de Dieppe est à 15 min à pied de l\'appartement. Quant aux véhicules, ils peuvent stationner gratuitement tout le long du front de mer.</span></p>[:]', '189', '198,196,191,189,188,186', 180000.00, 5, 30.00, 1, 2, 0, '95,94,93,92,91,90,88,87,86', 79, 19, 'publish', '2023-01-29 02:21:12', '2023-01-29 02:23:11', '[]', NULL),
