(48, '[:fr]Chambre simple[:]', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">\"Le Bas Fort Blanc\" est située sur l\'extrémité du Front de mer de Dieppe, côté Château de Dieppe.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Le Front de mer est un espace dynamique grâce aux diverses activités estivales organisées sur ses larges pelouses, comme le Festival International du Cerf-Volant, la fête foraine en été, activités sportives gratuites... De plus, vous y trouverez une piscine eau de mer chauffée avec centre de thalassothérapie, le Casino de Dieppe, le café Epson, le Château de Dieppe édifié dès le XIVe siècle, parc pour enfants et skate-parc, divers kiosques à glaces, chichi, crêpes...</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">L\'appartement est à 5 min à pied de la Grande Rue de Dieppe, où vous trouverez commerces, Grand marché du samedi (élu meilleur marché 2020 par TF1) etc.</span></p><p><span style=\"color: rgb(34, 34, 34);\">De plus, le restaurant \"Le Bas Fort Blanc\" et le Café \"Le Bar O Mètre\" sont à proximité du logement.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">La gare de Dieppe est à 15 min à pied de l\'appartement. Quant aux véhicules, ils peuvent stationner gratuitement tout le long du front de mer.</span></p>[:]', '200', '212,211,209,205,204,203,201,200', 70000.00, 8, 25.00, 1, 2, 0, '95,94,93,92,91,90,89,87,86', 81, 19, 'publish', '2023-01-29 02:31:30', '2023-01-29 02:33:08', '[]', NULL),
(49, '[:fr]Chambre normale[:]', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">Notre logement est situé dans un ancien corps de ferme, où nous avons créé 3 logements avec terrasse complètement indépendant (L\'Oxalis villas).</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Vous serez complètement indépendant au calme avec pour unique bruit le sifflement des oiseaux.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Le studio est situé dans un hameau de charme au beau milieu de la forêt.</span></p><p><span style=\"color: rgb(34, 34, 34);\">A deux pas du logement, de nombreuses balades vous attendent.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Vous pourrez aussi faire du sport, ou tout simplement vous ressourcer.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Les gros plus de ce logement :</span></p><p><span style=\"color: rgb(34, 34, 34);\">La literie (haut de gamme)</span></p><p><span style=\"color: rgb(34, 34, 34);\">La balnéothérapie</span></p><p><span style=\"color: rgb(34, 34, 34);\">La terrasse</span></p><p><span style=\"color: rgb(34, 34, 34);\">L\'emplacement en pleine nature</span></p><p><span style=\"color: rgb(34, 34, 34);\">Les équipements (ambiance lumière tamisé, choix de la couleur, Bluetooth pour mettre sa musique dans la chambre ou dans la balnéothérapie)</span></p><p><span style=\"color: rgb(34, 34, 34);\">La télévision est connectée à un lecteur de DVD, pas de chaîne (déconnexion totale)</span></p>[:]', '218', '227,221,218,216', 50000.00, 5, 30.00, 1, 2, 2, '94,93,92,91,90,88,86', 87, 25, 'publish', '2023-02-08 18:22:49', '2023-02-08 19:51:51', '[]', NULL),
