(6, '[:en]Hans Place IV[:vi]New apartment 1612103265[:ja]Hans Place IV[:]', 'hans-place-iv', '[:en]<p><span style=\"color: rgb(122, 122, 122);\">Hans Place IV is a three bedroom, three bathroom home in Knightsbridge. Sleekly designed and furnished with stylish pieces (the dining table, set with six lime-green chairs, is an especial highlight), this home’s living areas have a very upscale air. The master bedroom is impressive too, with a generous ensuite and doors onto the roof terrace, where there’s another table for six. The surrounding area’s just as elegant – close to all South Kensington’s boutiques, you’re also within walking distance of Harrods and the shop-and-café-lined King’s Road. What’s more, Knightsbridge tube station is just a six-minute walk from here.</span></p>[:vi]<p><span style=\"color: rgb(122, 122, 122);\">Hans Place IV is a three bedroom, three bathroom home in Knightsbridge. Sleekly designed and furnished with stylish pieces (the dining table, set with six lime-green chairs, is an especial highlight), this home’s living areas have a very upscale air. The master bedroom is impressive too, with a generous ensuite and doors onto the roof terrace, where there’s another table for six. The surrounding area’s just as elegant – close to all South Kensington’s boutiques, you’re also within walking distance of Harrods and the shop-and-café-lined King’s Road. What’s more, Knightsbridge tube station is just a six-minute walk from here.</span></p>[:ja]<p><span style=\"color: rgb(122, 122, 122);\">Hans Place IV is a three bedroom, three bathroom home in Knightsbridge. Sleekly designed and furnished with stylish pieces (the dining table, set with six lime-green chairs, is an especial highlight), this home’s living areas have a very upscale air. The master bedroom is impressive too, with a generous ensuite and doors onto the roof terrace, where there’s another table for six. The surrounding area’s just as elegant – close to all South Kensington’s boutiques, yo