(8, '[:en]Via della Scala[:vi]New apartment 1612103606[:ja]Via della Scala[:]', 'via-della-scala', '[:en]<p>Via della Scala is a home rich in culture and in colour. Entering into the kitchen, four can dine at the wooden table, and on the right you’ll come to the sitting room, painted in pastel-green. Beamed ceilings run above vintage porcelain and a classical bust, and there’s a bright boldness to the rounded magenta armchairs and purple rug. Just off the sitting room, the master bedroom has a blue-tiled ensuite, light-yellow walls and a queen-size bed.</p><p>Head up the spiral staircase, and you’ll come to the second bedroom. Rough-hewn beams contrast a contemporary wooden floor, and opposite the lime-green bedstead are a grey sofa and traditional writing desk. You’ll find sloping skylights in the white-tiled ensuite bathroom, next door, while the outdoor terrace has views over to the historic Janiculum Hill.</p>[:vi]<p>Via della Scala is a home rich in culture and in colour. Entering into the kitchen, four can dine at the wooden table, and on the right you’ll come to the sitting room, painted in pastel-green. Beamed ceilings run above vintage porcelain and a classical bust, and there’s a bright boldness to the rounded magenta armchairs and purple rug. Just off the sitting room, the master bedroom has a blue-tiled ensuite, light-yellow walls and a queen-size bed.</p><p>Head up the spiral staircase, and you’ll come to the second bedroom. Rough-hewn beams contrast a contemporary wooden floor, and opposite the lime-green bedstead are a grey sofa and traditional writing desk. You’ll find sloping skylights in the white-tiled ensuite bathroom, next door, while the outdoor terrace has views over to the historic Janiculum Hill.</p>[:ja]<p>Via della Scala is a home rich in culture and in colour. Entering into the kitchen, four can dine at the wooden table, and on the right you’ll come to the sitting room, painted in pastel-green. Beamed ceilings run above vintage porcelain 