(10, '[:en]Via di San Crisogono[:vi]New apartment 1612066086[:ja]Via di San Crisogono[:]', 'via-di-san-crisogono', '[:en]<p><span style=\"color: rgb(122, 122, 122);\">Trastevere-Gianicolo. This home’s white-painted rooms are all furnished with clean-cut pieces, but you’ll find lively touches – printed cushions and diverse, colourful artworks – and original details here too. There’s also a pretty rooftop terrace, with space to sit. Below, the bustling streets are lined with characterful boutiques and eateries, and you’ll find several historic churches within walking distance. You’re close to the Isola Tiberina and Campo de’ Fiori, and it’s just a two-minute walk to the nearest tram stop, Sonnino/s. Galliano.</span></p>[:vi]<p><span style=\"color: rgb(122, 122, 122);\">Trastevere-Gianicolo. This home’s white-painted rooms are all furnished with clean-cut pieces, but you’ll find lively touches – printed cushions and diverse, colourful artworks – and original details here too. There’s also a pretty rooftop terrace, with space to sit. Below, the bustling streets are lined with characterful boutiques and eateries, and you’ll find several historic churches within walking distance. You’re close to the Isola Tiberina and Campo de’ Fiori, and it’s just a two-minute walk to the nearest tram stop, Sonnino/s. Galliano.</span></p>[:ja]<p><span style=\"color: rgb(122, 122, 122);\">Trastevere-Gianicolo. This home’s white-painted rooms are all furnished with clean-cut pieces, but you’ll find lively touches – printed cushions and diverse, colourful artworks – and original details here too. There’s also a pretty rooftop terrace, with space to sit. Below, the bustling streets are lined with characterful boutiques and eateries, and you’ll find several historic churches within walking distance. You’re close to the Isola Tiberina and Campo de’ Fiori, and it’s just a two-minute walk to the nearest tram stop, Sonnino/s. Galliano.</span></p>[:]', 41.870000, -87.650000, '[:en]Chicago, IL 6060