(11, '[:en]Potts Point Terrace[:vi]New apartment 1612103364[:ja]Potts Point Terrace[:]', 'potts-point-terrace', '[:en]<p><span style=\"color: rgb(122, 122, 122);\">Quietly positioned on the ground floor of a Victorian Terrace this bright and cool, art-filled home will surprise you with its attention to detail and first-class finishing’s. A spacious flowing floorplan over two levels with two bedrooms, one bathroom and wash room to accommodate up to 4 people.</span></p><p><span style=\"color: rgb(122, 122, 122);\">This terrace has been bought into the 21st century with it’s paired- back design using raw materials such as exposed brick and hand carved sandstone to give a modern industrial feel. Simple but fashionable furnishings and artwork with pops of colour complement this home’s design. The kitchen is equipped with all modern appliances. The generously sized lounge area has two large glass doors opening onto a patio area looking into a small garden creating some privacy from the street. Downstairs is a cozy little reading nook, office, and separate laundry room. Master bedroom and the second bedroom sharing a beautifully renovated bathroom.</span></p>[:vi]<p><span style=\"color: rgb(122, 122, 122);\">Quietly positioned on the ground floor of a Victorian Terrace this bright and cool, art-filled home will surprise you with its attention to detail and first-class finishing’s. A spacious flowing floorplan over two levels with two bedrooms, one bathroom and wash room to accommodate up to 4 people.</span></p><p><span style=\"color: rgb(122, 122, 122);\">This terrace has been bought into the 21st century with it’s paired- back design using raw materials such as exposed brick and hand carved sandstone to give a modern industrial feel. Simple but fashionable furnishings and artwork with pops of colour complement this home’s design. The kitchen is equipped with all modern appliances. The generously sized lounge area has two large glass doors opening onto a patio area looking