(12, '[:en]Ebury Street[:vi]New apartment 1612103479[:ja]Ebury Street[:]', 'ebury-street', '[:en]<p>This three bedroom, three bathroom home in Belgravia hits all the right notes. The sitting room is classically decorated in white and powder-blue, and is separated by an arch into two clusters of chairs and sofas, with an ornamental fireplace and piano at one end. The kitchen is also smart and with traditional touches (like the oven mantle) mixed with more modern innovations such as the central breakfast bar.</p><p>There’s a trio of bedrooms, all with intricately patterned wallpaper. Each bedroom has an ensuite bathroom—the master ensuite has a decorative fireplace and a library ladder, and the third bedroom’s ensuite has hexagonal floor tiles and a pair of marble-clad showers. Lastly, there’s a wood-panelled dining room, and a circular dining table on the patio.</p>[:vi]<p>This three bedroom, three bathroom home in Belgravia hits all the right notes. The sitting room is classically decorated in white and powder-blue, and is separated by an arch into two clusters of chairs and sofas, with an ornamental fireplace and piano at one end. The kitchen is also smart and with traditional touches (like the oven mantle) mixed with more modern innovations such as the central breakfast bar.</p><p>There’s a trio of bedrooms, all with intricately patterned wallpaper. Each bedroom has an ensuite bathroom—the master ensuite has a decorative fireplace and a library ladder, and the third bedroom’s ensuite has hexagonal floor tiles and a pair of marble-clad showers. Lastly, there’s a wood-panelled dining room, and a circular dining table on the patio.</p>[:ja]<p>This three bedroom, three bathroom home in Belgravia hits all the right notes. The sitting room is classically decorated in white and powder-blue, and is separated by an arch into two clusters of chairs and sofas, with an ornamental fireplace and piano at one end. The kitchen is also smart and with traditional touches (like the 