(13, '[:en]Turtle Ridge[:vi]New apartment 1612102859[:ja]Turtle Ridge[:]', 'turtle-ridge', '[:en]<p>Find yourself in the perfect environment to make the most memorable vacation. Located in lower Bight, Turtle Ridge Villa sits directly overlooking the breathtaking award-winning Grace Bay beach. The views are amazing with only a 3 minute walk to the beach.</p><p>It’s said that the best in life is worth waiting for and this is certainly true of this beautiful three-bedroom villa with direct walkout onto the Pool deck with loungers, wet bar, outdoor kitchen and BBQ grill.</p><p>There are three bedrooms: 3 masters with king beds. Bedroom #3 can be converted to twins as needed upon request. All have bath ensuite. Living room as well as each bedroom have flat screen TV with Netflix. The villa comes fully-equipped with wireless internet, cable TV, metered air-conditioning (bedrooms only) and a fully-stocked kitchen and linen closet. There is a safe in each bedroom to store valuable items.</p>[:vi]<p>Find yourself in the perfect environment to make the most memorable vacation. Located in lower Bight, Turtle Ridge Villa sits directly overlooking the breathtaking award-winning Grace Bay beach. The views are amazing with only a 3 minute walk to the beach.</p><p>It’s said that the best in life is worth waiting for and this is certainly true of this beautiful three-bedroom villa with direct walkout onto the Pool deck with loungers, wet bar, outdoor kitchen and BBQ grill.</p><p>There are three bedrooms: 3 masters with king beds. Bedroom #3 can be converted to twins as needed upon request. All have bath ensuite. Living room as well as each bedroom have flat screen TV with Netflix. The villa comes fully-equipped with wireless internet, cable TV, metered air-conditioning (bedrooms only) and a fully-stocked kitchen and linen closet. There is a safe in each bedroom to store valuable items.</p>[:ja]<p>Find yourself in the perfect environment to make the most memorable vacation. Located 