(14, '[:en]Gregory Place[:vi]New apartment 1612103093[:ja]Gregory Place[:]', 'gregory-place', '[:en]<p>Tucked away on a lane in the heart of Kensington, Gregory Place is a home worth discovering. Vintage travel posters line the walls in the sitting room, to the left of the entrance hallway, which has wooden floors and a pair of cream sofas. There’s a skylight overhead, and to the left is the open-plan kitchen. It’s a contemporary space, with a round dining table for three and glossy black cabinets that stand out against white walls.</p><p>Straight ahead of the front door is the staircase to the first floor. The second bedroom is on the left, the third bedroom to the right. Both have shuttered windows and a varnished wooden floor, and the second bedroom has a double bed with a bright pink headboard. There’s a bathroom straight ahead, and another upstairs and to the left. Up here, there’s one room left to discover—the master bedroom, with its king-sized bed.</p>[:vi]<p>Tucked away on a lane in the heart of Kensington, Gregory Place is a home worth discovering. Vintage travel posters line the walls in the sitting room, to the left of the entrance hallway, which has wooden floors and a pair of cream sofas. There’s a skylight overhead, and to the left is the open-plan kitchen. It’s a contemporary space, with a round dining table for three and glossy black cabinets that stand out against white walls.</p><p>Straight ahead of the front door is the staircase to the first floor. The second bedroom is on the left, the third bedroom to the right. Both have shuttered windows and a varnished wooden floor, and the second bedroom has a double bed with a bright pink headboard. There’s a bathroom straight ahead, and another upstairs and to the left. Up here, there’s one room left to discover—the master bedroom, with its king-sized bed.</p>[:ja]<p>Tucked away on a lane in the heart of Kensington, Gregory Place is a home worth discovering. Vintage travel posters line the walls in the s