(22, '[:fr]Villa de l\'espérence[:]', 'villa-de-lesperence', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">Le Chalet Rytola a quatre chambres spacieuses avec salles de bains privées, ainsi qu\'une salle de jeux dans laquelle il est possible d\'ajouter trois list supplémentaires.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Sur la terrasse, vous trouverez un jacuzzi, des transats, un barbecue, ainsi que des tables et chaises.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au sein du hameau Nid des Pècles, vous avez accès à un sauna et une salle de fitness, toutes deux partagées.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Afin de rendre votre séjour encore plus agréable, nous pouvons vous offrir des services supplémentaires, tels que la préparation de vos petits-déjeuners, faire vos courses, s\'occuper de la location de matériel de montagne, et autres services de conciergerie.</span></p><p><span style=\"color: rgb(34, 34, 34);\">La Chalet Rytola est à 5 minutes de marche du centre-ville, et un parking gratuit, souterrain, et exclusife au hameau est aussi à votre disposition lors de votre séjour.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Ce chalet est la destination idéale pour une experience de luxe, en famille ou entre amis, dans la belle vallée de Chamonix.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Le prix inclus le linge de lit, les serviettes et peignoirs, et le nettoyage du chalet.</span></p>[:]', 5.291942, -3.981267, '[:fr]32 rue de la poudrière[:]', '12', NULL, NULL, NULL, NULL, '96', '96,95,94,93,92,91,90,89,88,87,86', 250000.00, 'instant', 10, 4, 2, 300.00, NULL, NULL, 'per_day', '[]', '98', '114,113,112,111,110,109,108,107,106,104', 'off', 5, '[:fr][:]', NULL, NULL, NULL, 'on', '[]', '', 21, 'publish', '2023-01-28 17:08:54', '2023-01-28 17:36:25', 'off', '', '[:fr][:]', '[]', NULL),
