(24, '[:fr]Villa des coeurs perdus[:]', 'villa-des-coeurs-perdus', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">Un endroit féerique idéal pour vous réunir, le splendide chalet les 3 Oursons surplombe la ville avec une magnifique vue sur Gérardmer à proximité de la station de ski de la Mauselaine.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Sur 3 niveaux, avec une surface de 254m², le chalet les 3 oursons bénéficie de 6 chambres, WC, 3 salles de bains</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au niveau principal : Une entrée spacieuse, un grand salon séjour avec cheminée donnant sur une cuisine américaine toute équipée (2 appareils à raclette et 2 appareils à fondue font aussi partie des équipements fournis), un WC, une chambre avec salle de bain privative et WC. Le salon séjour donne également accès à une grande et spacieuse terrasse avec table de Banquet et une plancha à gaz.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au 1er étage, 3 chambres doubles, une salle de bain spacieuse avec douche à l\'italienne, un WC.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Rez de Jardin, 2 chambres (pour 4 personnes), une grande salle de bain avec douche à l\'italienne et Sauna, une salle de jeu avec Air Hockey et Baby foot, un accès terrasse extérieur avec solarium et Jacuzzi.</span></p>[:]', 6.809107, -5.273263, '[:fr]98 avenue de la tristesse[:]', '12', NULL, NULL, NULL, NULL, '154', '159,158,157,156,155,154,153,152', 150000.00, 'instant', 10, 5, 3, 350.00, NULL, NULL, 'per_day', '[]', '98', '114,111,110,109,108,107,106', 'off', 5, '[:fr][:]', NULL, NULL, NULL, 'on', '[]', '', 17, 'publish', '2023-01-28 20:16:46', '2023-01-29 02:44:55', 'off', '', '[:fr][:]', '[]', NULL),
(25, '[:fr]La majestique[:]', 'la-majestique', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">Un endroit féerique idéal pour vous réunir, le splendide chalet les 3 Oursons surplombe la ville avec une magnifique vue sur Gérardmer à proximité de la station de ski de la Mauselaine.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Sur 3 niveaux, avec une surface de 254m², le chalet les 3 oursons bénéficie de 6 chambres, WC, 3 salles de bains</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au niveau principal : Une entrée spacieuse, un grand salon séjour avec cheminée donnant sur une cuisine américaine toute équipée (2 appareils à raclette et 2 appareils à fondue font aussi partie des équipements fournis), un WC, une chambre avec salle de bain privative et WC. Le salon séjour donne également accès à une grande et spacieuse terrasse avec table de Banquet et une plancha à gaz.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au 1er étage, 3 chambres doubles, une salle de bain spacieuse avec douche à l\'italienne, un WC.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Rez de Jardin, 2 chambres (pour 4 personnes), une grande salle de bain avec douche à l\'italienne et Sauna, une salle de jeu avec Air Hockey et Baby foot, un accès terrasse extérieur avec solarium et Jacuzzi.</span></p>[:]', 6.809107, -5.273263, '[:fr]244 rue du ministre[:]', '11.425716526868593', NULL, NULL, NULL, NULL, '162', '169,168,167,166,165,164,163,162,161,160', 260000.00, 'instant', 12, 6, 3, 400.00, NULL, NULL, 'per_day', '[]', '98', '114,112,111,110,108,107,106,104', 'off', 5, '[:fr][:]', NULL, NULL, NULL, 'on', '[]', '', 17, 'publish', '2023-01-28 20:19:27', '2023-01-29 02:44:50', 'off', '', '[:fr][:]', '[]', NULL),
