(28, '[:fr]Villa Suprême[:]', 'villa-supreme', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">Notre logement est situé dans un ancien corps de ferme, où nous avons créé 3 logements avec terrasse complètement indépendant (L\'Oxalis villas).</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Vous serez complètement indépendant au calme avec pour unique bruit le sifflement des oiseaux.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Le studio est situé dans un hameau de charme au beau milieu de la forêt.</span></p><p><span style=\"color: rgb(34, 34, 34);\">A deux pas du logement, de nombreuses balades vous attendent.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Vous pourrez aussi faire du sport, ou tout simplement vous ressourcer.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Les gros plus de ce logement :</span></p><p><span style=\"color: rgb(34, 34, 34);\">La literie (haut de gamme)</span></p><p><span style=\"color: rgb(34, 34, 34);\">La balnéothérapie</span></p><p><span style=\"color: rgb(34, 34, 34);\">La terrasse</span></p><p><span style=\"color: rgb(34, 34, 34);\">L\'emplacement en pleine nature</span></p><p><span style=\"color: rgb(34, 34, 34);\">Les équipements (ambiance lumière tamisé, choix de la couleur, Bluetooth pour mettre sa musique dans la chambre ou dans la balnéothérapie)</span></p><p><span style=\"color: rgb(34, 34, 34);\">La télévision est connectée à un lecteur de DVD, pas de chaîne (déconnexion totale)</span></p>[:]', 5.135077, -3.291662, '[:fr]76 Avenue de la République[:]', '12', NULL, NULL, NULL, NULL, '263', '264,263,262,261,260,259,258,257,256', 150000.00, 'instant', 15, 7, 4, 350.00, NULL, NULL, 'per_day', '[]', '98', '114,113,111,110,108,107,106,104', 'off', 5, '[:fr][:]', NULL, NULL, NULL, 'on', '[]', '', 25, 'publish', '2023-02-08 18:35:55', '2023-02-08 19:52:53', 'off', '', '[:fr][:]', '[]', NULL),
