rey, Carmel and 17-Mile Drive[:vi][:ja][:]\";s:7:\"content\";s:216:\"[:en]The pinch me moments continue as we follow the sun-kissed California coast, cruising scenic 17-Mile Drive. We return to Monterey for a visit of Cannery Row, immortalised in the John Steinbeck novel.[:vi][:ja][:]\";}i:16209659246548;a:2:{s:5:\"title\";s:75:\"[:en]Day 5: Monterey – Roaring Camp – Depart San Francisco[:vi][:ja][:]\";s:7:\"content\";s:244:\"[:en]California\'s towering redwoods provide an imposing backdrop for this morning as we journey back in time to the era of lumberjacks and sawmills in a re-created 1890s logging camp, complete with general store and railroad depot.[:vi][:ja][:]\";}}', 'a:3:{i:16209659355512;a:2:{s:8:\"question\";s:56:\"[:en]California\'s towering redwoods provide[:vi][:ja][:]\";s:6:\"answer\";s:244:\"[:en]California\'s towering redwoods provide an imposing backdrop for this morning as we journey back in time to the era of lumberjacks and sawmills in a re-created 1890s logging camp, complete with general store and railroad depot.[:vi][:ja][:]\";}i:16209659378175;a:2:{s:8:\"question\";s:56:\"[:en]California\'s towering redwoods provide[:vi][:ja][:]\";s:6:\"answer\";s:244:\"[:en]California\'s towering redwoods provide an imposing backdrop for this morning as we journey back in time to the era of lumberjacks and sawmills in a re-created 1890s logging camp, complete with general store and railroad depot.[:vi][:ja][:]\";}i:16209659381735;a:2:{s:8:\"question\";s:56:\"[:en]California\'s towering redwoods provide[:vi][:ja][:]\";s:6:\"answer\";s:244:\"[:en]California\'s towering redwoods provide an imposing backdrop for this morning as we journey back in time to the era of lumberjacks and sawmills in a re-created 1890s logging camp, complete with general store and railroad depot.[:vi][:ja][:]\";}}', 'on', 5, '[:en]Start and end in San Francisco! With the in-depth cultural tour Northern California Summer 2019, you have a 8 day tour package taking you through San Francisc