(16, '[:fr]Culture Urbain Salle[:]', 'culture-urbain-salle', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">La chambre tout en bois, agrémentée d\'une baignoire, offre une vue sur les montagnes environnantes et le petit village d\'Entremont. Les cloches des vaches et des moutons alentour se mêlent au bruissement d\'un petit torrent non loin. Parce que nous l\'avons voulu résolument nature, notre mazot est équipé de toilettes sèches, simples d\'utilisation (nous vous l\'expliquerons), situées à l\'étage inférieur.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">La chambre tout en bois, agrémentée d\'une baignoire, offre une vue sur les montagnes environnantes et le petit village d\'Entremont. Les cloches des vaches et des moutons alentour se mêlent au bruissement d\'un petit torrent non loin. Parce que nous l\'avons voulu résolument nature, notre mazot est équipé de toilettes sèches, simples d\'utilisation (nous vous l\'expliquerons), situées à l\'étage inférieur.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\"><span class=\"ql-cursor\">﻿</span>La chambre tout en bois, agrémentée d\'une baignoire, offre une vue sur les montagnes environnantes et le petit village d\'Entremont. Les cloches des vaches et des moutons alentour se mêlent au bruissement d\'un petit torrent non loin. Parce que nous l\'avons voulu résolument nature, notre mazot est équipé de toilettes sèches, simples d\'utilisation (nous vous l\'expliquerons), situées à l\'étage inférieur.</span></p>[:]', 5.435487, -4.029007, '[:fr]12 avenue de la joie[:]', '12', NULL, NULL, NULL, NULL, '120', '120,119,118,117,116,115,114,113', 450000.00, 450000.00, 450000.00, 'instant', 500, '[:fr]24[:]', 'date', '', '[]', '170', '159,158,157,156,155,154,153,128,127,126,125,124,123,122,121', '', '[]', '[]', '[]', 'off', 5, '[:fr][:]', NULL, 'on', '', 21, 'publish', '2023-01-28 17:30:52', '2023-01-28 17:36:54', NULL, '[]', NULL, '', ''),
(17, '[:fr]La piramide[:]', 'la-piramide', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">Un endroit féerique idéal pour vous réunir, le splendide chalet les 3 Oursons surplombe la ville avec une magnifique vue sur Gérardmer à proximité de la station de ski de la Mauselaine.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Sur 3 niveaux, avec une surface de 254m², le chalet les 3 oursons bénéficie de 6 chambres, WC, 3 salles de bains</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au niveau principal : Une entrée spacieuse, un grand salon séjour avec cheminée donnant sur une cuisine américaine toute équipée (2 appareils à raclette et 2 appareils à fondue font aussi partie des équipements fournis), un WC, une chambre avec salle de bain privative et WC. Le salon séjour donne également accès à une grande et spacieuse terrasse avec table de Banquet et une plancha à gaz.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au 1er étage, 3 chambres doubles, une salle de bain spacieuse avec douche à l\'italienne, un WC.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Rez de Jardin, 2 chambres (pour 4 personnes), une grande salle de bain avec douche à l\'italienne et Sauna, une salle de jeu avec Air Hockey et Baby foot, un accès terrasse extérieur avec solarium et Jacuzzi.</span></p>[:]', 6.809107, -5.273263, '[:fr]541 rue de la musique[:]', '10.816145891628503', NULL, NULL, NULL, NULL, '172', '178,177,176,175,174,173,172,171,170', 300000.00, 300000.00, 300000.00, 'instant', 135, '[:fr]5[:]', 'date', '', '[]', '171', '158,157,156,153,128,127,126,125,124,123,122,121', '', '[]', '[]', '[]', 'off', 5, '[:fr][:]', NULL, 'on', '', 17, 'publish', '2023-01-28 20:22:09', '2023-01-29 02:45:17', NULL, '[]', NULL, '', ''),
(18, '[:fr]L\'ambiance de chez nous[:]', 'lambiance-de-chez-nous', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">Un endroit féerique idéal pour vous réunir, le splendide chalet les 3 Oursons surplombe la ville avec une magnifique vue sur Gérardmer à proximité de la station de ski de la Mauselaine.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Sur 3 niveaux, avec une surface de 254m², le chalet les 3 oursons bénéficie de 6 chambres, WC, 3 salles de bains</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au niveau principal : Une entrée spacieuse, un grand salon séjour avec cheminée donnant sur une cuisine américaine toute équipée (2 appareils à raclette et 2 appareils à fondue font aussi partie des équipements fournis), un WC, une chambre avec salle de bain privative et WC. Le salon séjour donne également accès à une grande et spacieuse terrasse avec table de Banquet et une plancha à gaz.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Au 1er étage, 3 chambres doubles, une salle de bain spacieuse avec douche à l\'italienne, un WC.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Rez de Jardin, 2 chambres (pour 4 personnes), une grande salle de bain avec douche à l\'italienne et Sauna, une salle de jeu avec Air Hockey et Baby foot, un accès terrasse extérieur avec solarium et Jacuzzi.</span></p>[:]', 6.809107, -5.273263, '[:fr]90 rue princesse[:]', '11.284594393173872', NULL, NULL, NULL, NULL, '179', '185,184,183,182,181,180,179,178', 150000.00, 150000.00, 150000.00, 'instant', 200, '[:fr]10[:]', 'date', '', '[]', '171', '158,156,154,153,126,125,124,122,121', '', '[]', '[]', '[]', 'off', 5, '[:fr][:]', NULL, 'on', '', 17, 'publish', '2023-01-28 20:34:58', '2023-01-29 02:45:12', NULL, '[]', NULL, '', ''),
(19, '[:fr]New tour 1675297824[:]', 'new-tour-1675297824', '[:fr][:]', 21.023985, 105.791488, '[:fr][:]', '12', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'instant', 1, '[:fr]30[:]', 'date', NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'on', NULL, 1, 'publish', '2023-02-02 06:30:24', '2023-02-08 19:53:08', NULL, NULL, '2023-02-08 19:53:08', NULL, NULL),
(20, '[:fr]Wedding Space Assinie[:]', 'wedding-space-assinie', '[:fr]<p><span style=\"color: rgb(34, 34, 34);\">Notre logement est situé dans un ancien corps de ferme, où nous avons créé 3 logements avec terrasse complètement indépendant (L\'Oxalis villas).</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Vous serez complètement indépendant au calme avec pour unique bruit le sifflement des oiseaux.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Le studio est situé dans un hameau de charme au beau milieu de la forêt.</span></p><p><span style=\"color: rgb(34, 34, 34);\">A deux pas du logement, de nombreuses balades vous attendent.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Vous pourrez aussi faire du sport, ou tout simplement vous ressourcer.</span></p><p><br /></p><p><span style=\"color: rgb(34, 34, 34);\">Les gros plus de ce logement :</span></p><p><span style=\"color: rgb(34, 34, 34);\">La literie (haut de gamme)</span></p><p><span style=\"color: rgb(34, 34, 34);\">La balnéothérapie</span></p><p><span style=\"color: rgb(34, 34, 34);\">La terrasse</span></p><p><span style=\"color: rgb(34, 34, 34);\">L\'emplacement en pleine nature</span></p><p><span style=\"color: rgb(34, 34, 34);\">Les équipements (ambiance lumière tamisé, choix de la couleur, Bluetooth pour mettre sa musique dans la chambre ou dans la balnéothérapie)</span></p><p><span style=\"color: rgb(34, 34, 34);\">La télévision est connectée à un lecteur de DVD, pas de chaîne (déconnexion totale)</span></p>[:]', 5.135077, -3.291662, '[:fr]123 rue jean de la fontaine[:]', '12', NULL, NULL, NULL, NULL, '266', '268,267,266,265,264', 450000.00, 450000.00, 450000.00, 'instant', 350, '[:fr]10[:]', 'date', '', '[]', '', '159,158,157,156,155,154,153,128,127,126,125,124,123,122,121', '', '[]', '[]', '[]', 'off', 5, '[:fr][:]', NULL, 'on', '', 25, 'publish', '2023-02-08 18:42:10', '2023-02-08 19:53:11', NULL, '[]', NULL, '', '');
